import styled from "styled-components";

const Gallery = () => {
  fetch("http://d7jf0xz6rqdl6.cloudfront.net/")
    .then((res) => res.json())
    .then((data) => console.log(data));
  return (
    <div>
      <p>Gallery</p>
    </div>
  );
};
export default Gallery;
